int main(int argc, char** argv){
    if ((argc == 1) || (argc % 2 == 0))
        return -1;
    
    for (int pair =  0; pair < ((argc - 1) / 2); pair++){
        int cnt = 0;        
        int lower = atoi(argv[2*pair + 1]);
        int upper = atoi(argv[2*pair + 2]);
        if (lower < upper){
            bool sumtr = false;
            bool fnd = false;
            for (int i = 0; i < Size; i++){
                if ((!sumtr) && (Data[i] == lower)){
                    sumtr = true;
                    fnd = true;
                }
                if (sumtr)
                    cnt += primes[Data[i]];
                if ((sumtr) && (Data[i] == upper)){
                    sumtr = false;
                    i = Size;
                }
            }
            if (sumtr){
                printf("0");
                return 0;
            }
            if (!fnd){
                printf("0");
                return 0;
            }
        }
        printf("%d\n", cnt);
    }
    
    return 0;
}
